import React from "react";
import { Card, Avatar } from "antd";

const UserProfile = () => {
  return (
    <Card
      actions={[
        <div key="twit">
          짹잭
          <br />0
        </div>,
        <div key="followings">
          팔로잉
          <br />0
        </div>,
        <div key="followers">
          팔로워
          <br />0
        </div>,
      ]}
    >
      <Card.Meta avatar={<Avatar>CH</Avatar>} title="Chaehyeon" />
      <Button></Button>
    </Card>
  );
};

export default UserProfile;
